package Arrayconcept;

public class fetch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		{
			int[] numbers= {12,20,14,44};
			String[] st= {"suresh","selenium","Projet"};
			 for (int number: numbers) {          //foreach loop int array
			      System.out.println(number);
			 }
			 for (String s1:st) {          //for each loop string array
				 System.out.println(s1);
			 }
		}

	}

}
